import React from "react";
import Box from '@mui/material/Box';
import './ChatPage.css'

const ChatPage = () => {
        <Box 
            height={500}
            width={500}
            my={4}
            mx={55}
            display="flex"
            alignItems="center"
            gap={4}
            p={2}
            sx={{ 
                border: '2px solid black', 
                fontFamily: 'Times',
                backgroundColor: "white",
            }}
    >
    </Box>
}

export default ChatPage
